import { element } from 'prop-types';
import './App.css';
import Header from './components/Head';
import Movies from './components/Movies';
import movies from './movie.json';

function App() {
  return (
    <div className="App">
      <Header />
      <div className='main'>
        {
          movies.map((element) =>{
            <Movies 
            title={element.Title}
            year = {element.Year}
            img = {element.Poster}
            />
          })    
        }


      </div>

    </div>
  );
}

export default App;
